import React , {Component} from 'react';


class Table extends Component {
    constructor(props){
        super(props)
    }
    render(){
        return(
            <table>
               <thead>
                    <tr>
                        <th>#</th>
                        <th>Статус</th>
                        <th>Действие</th>
                        <th>Описание</th>
                    </tr>
                </thead>
            </table>
        )
    }
}
export default Table
